                <span className="sales-name">Nguyễn Nam</span> đã chốt đơn vào lúc 11h30 với ghi chú - khách đặt 1 hộp
              </div>
              <div className="sidebar-right-title">
                Nhắc việc của tôi
              </div>
              <div className="line">
                <span className="sales-name">Nguyễn Nam</span> đã chốt đơn vào lúc 11h30 với ghi chú - khách đặt 1 hộp
              </div>
              <div className="line">
                <span className="sales-name">Nguyễn Nam</span> đã chốt đơn vào lúc 11h30 với ghi chú - khách đặt 1 hộp
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default All
